void initVGA()
{
    BgaSetVideoMode(640, 480, 8, 0, 1);
    term_flag = 0;
}

uint16_t isBGAAvailable()
{
    outw(VBE_DISPI_INDEX_ID, VBE_DISPI_IOPORT_INDEX);
    return inw(VBE_DISPI_IOPORT_DATA);
}

void BgaWriteRegister(unsigned short IndexValue, unsigned short DataValue)
{
    outw(IndexValue, VBE_DISPI_IOPORT_INDEX);
    outw(DataValue, VBE_DISPI_IOPORT_DATA);
}
 
unsigned short BgaReadRegister(unsigned short IndexValue)
{
    outw(IndexValue, VBE_DISPI_IOPORT_INDEX);
    return inw(VBE_DISPI_IOPORT_DATA);
}
 
void BgaSetVideoMode(unsigned int Width, unsigned int Height, unsigned int BitDepth, int UseLinearFrameBuffer, int ClearVideoMemory)
{
    BgaWriteRegister(VBE_DISPI_INDEX_ENABLE, VBE_DISPI_DISABLED);
    BgaWriteRegister(VBE_DISPI_INDEX_XRES, Width);
    BgaWriteRegister(VBE_DISPI_INDEX_YRES, Height);
    xres = Width;
    yres = Height;
    BgaWriteRegister(VBE_DISPI_INDEX_BPP, BitDepth);
    BgaWriteRegister(VBE_DISPI_INDEX_VIRT_WIDTH, Width);
    // BgaWriteRegister(VBE_DISPI_INDEX_VIRT_HEIGHT, Height);
    BgaSetBank(0);
    cur_bank = 0;
    BgaWriteRegister(VBE_DISPI_INDEX_X_OFFSET, 0);
    BgaWriteRegister(VBE_DISPI_INDEX_Y_OFFSET, 0);

    BgaWriteRegister(VBE_DISPI_INDEX_ENABLE, VBE_DISPI_ENABLED |
        (UseLinearFrameBuffer ? VBE_DISPI_LFB_ENABLED : 0) |
        (ClearVideoMemory ? 0 : VBE_DISPI_NOCLEARMEM));
}
 
void BgaSetBank(unsigned short BankNumber)
{
    BgaWriteRegister(VBE_DISPI_INDEX_BANK, BankNumber);
}

void putpixel(int pos_x, int pos_y, unsigned char VGA_COLOR, int bgflag)
{
    disable_cursor = 1;
    if (pos_x < 0 || pos_x >= 640 || pos_y < 0 || pos_y > 480)
    {
        return;
    }
    
    int offset = xres * pos_y + pos_x;
    int bankoff = 0;
    int prevbank = cur_bank;
    if (offset >= 0 && offset < 65536)
    {
        bankoff = 0;
        cur_bank = 0;
    }
    else if (offset >= 65536 && offset < 131072)
    {
        cur_bank = 1;
        bankoff = 65536;
    }
    else if (offset >= 131072 && offset < 196608)
    {
        cur_bank = 2;
        bankoff = 131072;
    }
    else if (offset >= 196608 && offset < 262144)
    {
        cur_bank = 3;
        bankoff = 196608;
    }
    else if (offset >= 262144)
    {
        cur_bank = 4;
        bankoff = 262144;
    }
    if (prevbank != cur_bank)
    {
        BgaSetBank(cur_bank);
    }
    unsigned char* location = (unsigned char*)0xA0000 + xres * pos_y + pos_x - bankoff;
    unsigned char* pagelocation = (unsigned char*)0x8800000 + offset;
    *location = VGA_COLOR;
    if (bgflag)
    {
        *pagelocation = VGA_COLOR;
    }
    disable_cursor = 0;
}


void putpixelbackup(int pos_x, int pos_y, unsigned char VGA_COLOR, int bgflag, int termidx)
{
    if (pos_x < 0 || pos_x >= 640 || pos_y < 0 || pos_y > 480)
    {
        return;
    }
    
    int offset = xres * pos_y + pos_x;
    
    unsigned char* pagelocation = (unsigned char*)0x8800000 + termidx*0x400000 + offset;
    *pagelocation = VGA_COLOR;
}

void drawrect(int pos_x, int pos_y, int width, int height, unsigned char VGA_COLOR)
{
    int i, j;


    for (j = 0; j < height; j++)
    {
        for (i = 0; i < width; i++)
        {
            if (((pos_x + i) >= xres) || ((pos_y + j) >= yres) || ((pos_x + i) < 0) || ((pos_y + j) < 0))
            {
                continue;
            }
            putpixel(pos_x + i, pos_y+j, VGA_COLOR, 1);
        }
    }
}

void drawrectbackup(int pos_x, int pos_y, int width, int height, unsigned char VGA_COLOR, int termidx)
{
    int i, j;


    for (j = 0; j < height; j++)
    {
        for (i = 0; i < width; i++)
        {
            if (((pos_x + i) >= xres) || ((pos_y + j) >= yres) || ((pos_x + i) < 0) || ((pos_y + j) < 0))
            {
                continue;
            }
            putpixelbackup(pos_x + i, pos_y+j, VGA_COLOR, 1, termidx);
        }
    }
}

