void printchar(int pos_x, int pos_y, char c, unsigned char color)
{
    int i, k;
    int x = pos_x*8;
    int y = pos_y*16+28;
   for (i = 0; i < 16; i++) 
    {
        int off = 0;
        for (k = 0; k < FONT_WIDTH; k++)
        {
            
            // check if current bit is 1 or 0
            if (fontdata[(int)c][i] & (1<<(FONT_WIDTH - 1 - k)))
            {
                // if current bit is 1, set color to foregorund
                putpixel(x+off, y+i, color, 1);
            }
            else
            {
                putpixel(x+off, y+i, BLACK, 1);
            }
            off++;
        }
    } 
}

