void scroll()
{
    int i,j;
    for (j = 44; j < 440; j++)
    {
        for (i = 0; i < 640; i++)
        {
            int offset = xres * j + i;
            unsigned char color_ = *((unsigned char *)(0x8800000 + offset));
            putpixel(i, j-16, color_, 1);

        }
    }
}

void refresh()
{
    int i,j;
    for (j = 28; j < 440; j++)
    {
        for (i = 0; i < 640; i++)
        {
            int offset = xres * j + i;
            unsigned char color_ = *((unsigned char *)(0x8800000 + offset));
            putpixel(i, j, color_, 0);

        }
    }
}

void scrollbackup(int termidx)
{
    int i,j;
    for (j = 44; j < 440; j++)
    {
        for (i = 0; i < 640; i++)
        {
            int offset = xres * j + i;
            unsigned char color_ = *((unsigned char *)(0x8800000+termidx*0x400000 + offset));
            putpixelbackup(i, j-16, color_, 1, termidx);
        }
    }
}

