void mask_cursor()
{
    int i,j;
    for (j = 0;  j < 21; j++)
    {
        for (i = 0; i < 12; i++)
        {
            int offset = xres * (oldcursory+j) + (oldcursorx+i);
            unsigned char color_ = *((unsigned char *)(0x8800000 + offset));
            putpixel(oldcursorx+i, oldcursory+j, color_, 1);
        }
    }
    mask_flag = 0;
}

void printcursor(int pos_x, int pos_y, unsigned char outline, unsigned char color, int flag)
{
    if (disable_cursor)
    {
        return;
    }
    int i,j,k; // for loop iterator variables

    //restore
    if (flag && mask_flag)
    {
        for (j = 0;  j < 21; j++)
        {
            for (i = 0; i < 12; i++)
            {
                int offset = xres * (oldcursory+j) + (oldcursorx+i);
                unsigned char color_ = *((unsigned char *)(0x8800000 + offset));
                putpixel(oldcursorx+i, oldcursory+j, color_, 1);
            }
        }
    }
    mask_flag = 1;

    //update mask
    oldcursorx = pos_x;
    oldcursory = pos_y;

    // converts string to image buffer
    for (i = 0; i < 16; i++) 
    {
        // stores current x coord 
        int curr_off = 0;

        // loop through each char of string
        for (j = 0; j < 2; j++)
        {
            // loop through each bit of the char
            for (k = 0; k < FONT_WIDTH; k++)
            {
                // check if current bit is 1 or 0
                if (cursoroutline[j][i] & (1<<(FONT_WIDTH - 1 - k)))
                {
                    // if current bit is 1, set color to foregorund
                   putpixel(pos_x + curr_off, pos_y+i, outline, 0);
                }
                if (cursor[j][i] & (1<<(FONT_WIDTH - 1 - k)))
                {
                    // if current bit is 1, set color to foregorund
                   putpixel(pos_x + curr_off, pos_y+i, color, 0);
                }

                // offset points to next x-coord
                curr_off++;
            }
        }
        curr_off = 0;
        for (j = 2; j < 4; j++)
        {
            // loop through each bit of the char
            for (k = 0; k < FONT_WIDTH; k++)
            {
                // check if current bit is 1 or 0
                if (cursoroutline[j][i] & (1<<(FONT_WIDTH - 1 - k)))
                {
                    // if current bit is 1, set color to foregorund
                   putpixel(pos_x + curr_off, pos_y+i+16, outline, 0);
                }
                if (cursor[j][i] & (1<<(FONT_WIDTH - 1 - k)))
                {
                    // if current bit is 1, set color to foregorund
                   putpixel(pos_x + curr_off, pos_y+i+16, color, 0);
                }

                // offset points to next x-coord
                curr_off++;
            }
        }
    }
    return;
}

