void printTime()
{
    if (lockscreen_flag)
    {
        drawrect(540, 440, 100, 40, NAVYBLUE);
        int ts = 540;
        time_t* cur_time = rtc_get_time();
        uint8_t hour = cur_time->hours;
        uint8_t minute = cur_time->minutes;
        uint8_t sec = cur_time->seconds;
        int pm = 0;
        if (hour >= 12)
        {
            pm = 1;
            if (hour != 12)
            {
                hour %= 12;
            }
        }
        if (hour == 0)
        {
            hour = 12;
        }

        if(hour >= 10)
        {

        }
        char hourarr[3];
        itoa(hour, hourarr, 10);

        char minarr[3];
        itoa(minute, minarr, 10);

        char secarr[3];
        itoa(sec, secarr, 10);

        printstring(ts, 443, hourarr, LAVENDER);

        if(hour >= 10)
        {
            ts+=16;
        }
        else
        {
            ts += 8;
        }
        printstring(ts, 443, ":", LAVENDER);
        ts+=8;
        if (minute < 10)
        {
            printstring(ts, 443, "0", LAVENDER);
            ts+=8;
            printstring(ts, 443, minarr, LAVENDER);
            ts+=8;
        }
        else
        {
            printstring(ts, 443, minarr, LAVENDER);
            ts+=16;
        }

        printstring(ts, 443, ":", LAVENDER);
        ts+=8;
        if (sec < 10)
        {
            printstring(ts, 443, "0", LAVENDER);
            ts+=8;
            printstring(ts, 443, secarr, LAVENDER);
            ts+=8;
        }
        else
        {
            printstring(ts, 443, secarr, LAVENDER);
            ts+=16;
        }    

        ts+=8;
        if (pm)
        {
            printstring(ts, 443, "PM", LAVENDER);
        }
        else
        {
            printstring(ts, 443, "AM", LAVENDER);
        }

        uint8_t day =  cur_time->day_of_month; // 131
        uint8_t month =  cur_time->month;        // 1-12
        uint8_t year =  cur_time->year;       // 0-99
        
        char dayarr[3];
        itoa(day, dayarr, 10);

        char montharr[3];
        itoa(month, montharr, 10);

        char yeararr[3];
        itoa(year, yeararr, 10);

        int ds = 550;

        printstring(ds, 461, montharr, LAVENDER);
        ds+=8;
        if (month>9)
        {
            ds+=8;
        }
        printstring(ds, 461, "/", LAVENDER);
        ds+=8;
        
        printstring(ds, 461, dayarr, LAVENDER);
        ds+=8;
        if (day>9)
        {
            ds+=8;
        }
        printstring(ds, 461, "/20", LAVENDER);
        ds+=24;

        printstring(ds, 461, yeararr, LAVENDER);
    }
}

