void drawPaint(int pos_x, int pos_y, int size, unsigned char color)
{
    int i, j;
    for (j = 0; j < 16; j++)
    {
        for (i = 0; i < 16; i++)
        {
            if (paintsize[j][i] != 0 && paintsize[j][i] <= size)
            {
                if((pos_y+j-7)>= 58 && (pos_y+j-7) < 440)
                putpixel(pos_x+i-7, pos_y+j-7, color, 1);
            }
        }
    }
}

void drawSizeIcon(int pos_x, int pos_y, int size)
{
    int i, j;
    for (j = 0; j < 16; j++)
    {
        for (i = 0; i < 16; i++)
        {
            if (paintsize[j][i] != 0 && paintsize[j][i] <= size)
            {
                putpixel(pos_x+i, pos_y+j, BLACK, 1);
            }
        }
    }
}


