void printTTT(int x, int y, char square[9])
{
    int i, j;
    for (j = 0; j < 3; j++)
    {
        for (i = 0; i < 3; i++)
        {
            int idx = j*3+i;
            int xoff = 30;
            int yoff = 22;
            if (square[idx] == 'X')
            {
                printlargestring(x+78*i+xoff,y+78*j+yoff, "X", 34);
            }
            else if (square[idx] == 'O')
            {
                printlargestring(x+78*i+xoff,y+78*j+yoff, "O", 34);
            }
            else
            {
                drawrect(x+78*i+xoff,y+78*j+yoff,16,32,BLACK);
            }
        }
    }

}

char checkwin(char square[9])
{
    if (square[0] == square[1] && square[1] == square[2] && square[0]!=0)
        return square[0];
        
    else if (square[3] == square[4] && square[4] == square[5] && square[3]!=0)
        return square[3];
        
    else if (square[6] == square[7] && square[7] == square[8] && square[6]!=0)
        return square[6];
        
    else if (square[0] == square[3] && square[3] == square[6] && square[0]!=0)
        return square[0];
        
    else if (square[1] == square[4] && square[4] == square[7] && square[1]!=0)
        return square[1];
        
    else if (square[2] == square[5] && square[5] == square[8] && square[2]!=0)
        return square[2];
        
    else if (square[0] == square[4] && square[4] == square[8] && square[0]!=0)
        return square[0];
        
    else if (square[2] == square[4] && square[4] == square[6] && square[2]!=0)
        return square[2];
    
    int i;
    for (i = 0; i < 9; i++)
    {
        if (square[i] == 0)
        {
            return 1;
        }
    }

    return  0;
}

void piano_change_octave(int octave)
{
    if (!(octave > 1 && octave < 7)) return;

    char oct[2];

    cur_octave = octave;
    itoa(cur_octave, oct, 10);
    drawrect(186, 400, 48, 32, WHITE);
    printlargestring(202, 400, oct, RED);

}


