void runTTT()
{
    desktopflag = 0;
    renderHeader("TicTacToe");
    renderTaskbar();
    drawrect(0, 28, 640, 412, BLACK);

    int x = 205;
    int y = 50;
    drawrect(x+75, y, 3, 231, 34);
    drawrect(x+75+3+75, y, 3, 231, 34);
    drawrect(x, y+75, 231, 3, 34);
    drawrect(x, y+75+3+75, 231, 3, 34);

    // printlargestring(192, 350, "Player 'X' Wins!", 34);
    // printlargestring(192, 350, "Player 'O' Wins!", 34);
    drawrect(192, 350, 256, 32, BLACK);
    printlargestring(192, 350, "Player 'X's Turn", 34);
    // printlargestring(192, 350, "Player 'O's Turn", 34);

    char square[9] = { 0, 0, 0, 0, 0, 0, 0, 0, 0};

    printTTT(x, y, square);

    renderTTTReset(20, 50);

    int count = 0;
    int done = 0;
    int tie = 0;
    int win = 0;
    char ret  = 1;
    int wait = 0;


    while (!(lclick && cursorInBounds(600, 640, 0, 28)))
    {
        if (lclick && cursorInBounds(20+2, 20+2+70, 50+2, 50+2+44))
        {
            count  = 0;
            memset((void *)square, 0, 9);
            printTTT(x, y, square);
            done = 0;
            tie = 0;
            win = 0;
            drawrect(192, 350, 256, 32, BLACK);
            printlargestring(192, 350, "Player 'X's Turn", 34);
            ret = 1;
            wait = 0;
        }
        if (done == 0)
        {
            if (count == 9)
            {
                done = 1;
            }
            int square_clicked = -1;
            if (lclick)
            {
                int i, j;
                for (j = 0; j < 3; j++)
                {
                    for (i = 0; i < 3; i++)
                    {
                        int idx = j*3+i;
                        if (cursorInBounds(x+78*i, x+78*i+75, y+78*j,y+78*j+75))
                        {
                            square_clicked = idx;
                            break;
                        }
                    }
                    if (square_clicked != -1) break;
                }
                while(lclick){;}
            }
            if (square_clicked != -1)
            {
                if (square[square_clicked] == 0)
                {
                    if (count%2)
                    {
                        square[square_clicked] = 'O';
                        drawrect(192, 350, 256, 32, BLACK);
                        printlargestring(192, 350, "Player 'X's Turn", 34);
                    }
                    else
                    {
                        square[square_clicked] = 'X';
                        drawrect(192, 350, 256, 32, BLACK);
                        printlargestring(192, 350, "Player 'O's Turn", 34);
                    }
                    printTTT(x, y, square);
                    ret = checkwin(square);
                    if(ret == 1)
                        count++;
                    else
                    {
                        done = 1;
                        if (ret == 0)
                        {
                            tie = 1;
                        }
                        else
                        {
                            win = 1;
                        }
                    }
                }
            }
        }
        if (tie)
        {
            drawrect(192, 350, 256, 32, BLACK);
            printlargestring(288, 350, "TIE!", 34);
            tie = 0;
        }
        if (win)
        {
            win = 0;
            if(count%2)
            {
                drawrect(192, 350, 256, 32, BLACK);
                printlargestring(192, 350, "Player 'O' Wins!", 34);
            }
            else 
            {
                drawrect(192, 350, 256, 32, BLACK);
                printlargestring(192, 350, "Player 'X' Wins!", 34);
            }
        }
    }

    // term_flag = 0;
    renderDesktop();
    desktopflag = 1;
}



void runGUI()
{
    stop_pressed = 0;
    musicmode = 0;
    pianomode = 0;
    lockscreen_flag = 0;
    
    renderLockScreen();

    lockscreen_flag = 1;

    renderDesktop();
    lockscreenflag = 0;
    desktopflag = 1;
    while (1)
    {
        if (desktopflag)
        {
            if (lclick && cursorInBounds(30, 90, 130, 190))
            {
                click_sound();
                runPaint();
            }

            else if (lclick && cursorInBounds(30, 90, 230, 290))
            {
                click_sound();
                runTerminal();
            }

            else if (lclick && cursorInBounds(30, 90, 30, 90))
            {
                click_sound();
                runCalculator();
            }

            else if (lclick && cursorInBounds(120, 180, 130, 190))
            {
                click_sound();
                runTTT();
            }

            else if (lclick && cursorInBounds(120, 180, 30, 90))
            {
                click_sound();
                runPiano();
            }
            else if (lclick && cursorInBounds(30, 90, 330, 390))
            {
                click_sound();
                runMusic();
            }
            
        }

    }
}


